import { UserObserverService } from './UserObserverService'
import { UserObserverUseCase } from './UserObserverUseCase'

function createUserObserverUseCase(
  getUserObserverService: UserObserverService,
): UserObserverUseCase {
  return function (callback) {
    getUserObserverService(callback)
  }
}

export { createUserObserverUseCase }
